import { useEffect } from 'react';

function JsonFetcher({ url, onDataFetch }) {
  useEffect(() => {
    fetch(url)
      .then(response => response.json())
      .then(data => {
        onDataFetch(data);
      })
      .catch(error => {
        console.log('Error:', error);
      });
  }, [url, onDataFetch]);

  return null;
}

export default JsonFetcher;
